import Layout from '../Layout/Layout';

const LandingPage = () => {

      const renderLandingPage = () => (
          <Layout title="Save our Delicacies" background={true}>

              <section>
                <h1 style={{color:'var(--primary-orange)', fontFamily:'Roboto Bold'}}>indiCafe</h1>
                <p>
                  <button className="btn btn-warning"></button>
                </p>
                </section> 
          </Layout>
      )
    return (
        <>
          {renderLandingPage()}  
        </>
    )
}

export default LandingPage
